					node distance=1.5cm,
					>=stealth
				]
				\tikzstyle{every state} = [draw=blue!50, very thick, fill=blue!20]
				\tikzstyle{decode} = [circle, draw=green!50, very thick, fill=green!20]
				\tikzstyle{accepting} = [accepting by arrow]
				\node[state] (h_0) {$h_0$};
				\node[state] (h_1) [right of=h_0] {$h_1$};
				\node[state] (h_2) [right of=h_1] {$h_2$};
				\node[state] (h_3) [right of=h_2] {$h_3$};
				\node[state] (h_4) [right of=h_3] {$h_4$};
				\node[state] (x_0) [below of=h_0] {$x_0$};
				\node[state] (x_1) [below of=h_1] {$x_1$};
				\node[state] (x_2) [below of=h_2] {$x_2$};
				\node[state] (x_3) [below of=h_3] {$x_3$};
				\node[state] (x_4) [below of=h_4] {$x_4$};
				\node[] (l_0) [below of=x_0] {I};
				\node[] (l_1) [below of=x_1] {have};
				\node[] (l_2) [below of=x_2] {a};
				\node[] (l_3) [below of=x_3] {pen};
				\node[] (l_4) [below of=x_4] {EOS};
				\node[state] (z_0) [above of=h_0] {$z_0$};
				\node[state] (z_1) [above of=h_1] {$z_1$};
				\node[state] (z_2) [above of=h_2] {$z_2$};
				\node[state] (z_3) [above of=h_3] {$z_3$};
				\node[state] (z_4) [above of=h_4] {$z_4$};
				\path[->] (x_0) edge node [above] {} (h_0)
				(x_1) edge node [above] {} (h_1)
				(x_2) edge node [above] {} (h_2)
				(x_3) edge node [above] {} (h_3)
				(x_4) edge node [above] {} (h_4)
				(h_0) edge node [above] {} (z_0)
				(h_1) edge node [above] {} (z_1)
				(h_2) edge node [above] {} (z_2)
				(h_3) edge node [above] {} (z_3)
				(h_4) edge node [above] {} (z_4)
