				\node[state] (c_i) [above of=z_2] {$c_t$};
				\path[->] (h_0) edge node [above] {} (h_1)
				(h_1) edge node [above] {} (h_2)
				(h_2) edge node [above] {} (h_3)
				(h_3) edge node [above] {} (h_4)
