				(z_1) edge[bend left=30] node [above,pos=0.2] {$\alpha_1^t$} (c_i)
				(z_2) edge[bend left=0] node [right, pos=0.2] {$\alpha_2^t$} (c_i)
				(z_3) edge[bend right=15] node [above, pos=0.2] {$\alpha_3^t$} (c_i)
				(z_4) edge[bend right=15] node [above, pos=0.2] {$\alpha_4^t$} (c_i)
				;

				\node[decode] (s_0) [above right of=c_i] {$s_{0}$};
				\node[decode] (s_1) [right of=s_0] {$s_{1}$};
				\node[decode] (s_2) [right of=s_1] {$s_{2}$};
				\node[decode] (s_3) [right of=s_2] {$s_{t}$};
				\node[decode] (s_4) [right of=s_3] {$s_{4}$};
				\node[decode] (s_5) [right of=s_4] {$s_{5}$};
				\node[decode] (g_0) [above of=s_0] {$g_0$};
				\node[decode] (g_1) [above of=s_1] {$g_1$};
				\node[decode] (g_2) [above of=s_2] {$g_2$};
				\node[decode] (g_3) [above of=s_3] {$g_t$};
				\node[decode] (g_4) [above of=s_4] {$g_4$};
				\node[decode] (g_5) [above of=s_5] {$g_5$};
				\node[] (o_0) [above of=g_0] {私};
				\node[] (o_1) [above of=g_1] {は};
				\node[] (o_2) [above of=g_2] {ペン};
				\node[] (o_3) [above of=g_3] {を};
				\node[] (o_4) [above of=g_4] {持つ};
				\node[] (o_5) [above of=g_5] {EOS};
				\path[->]
				% (c_i) edge[bend right=15] node {} (s_0)
				% (c_i) edge[bend right=15] node {} (s_1)
				% (c_i) edge[bend right=15] node {} (s_2)
				(c_i) edge[bend right=15] node {} (s_3)
				% (c_i) edge[bend right=15] node {} (s_4)
				% (c_i) edge[bend right=15] node {} (s_5)
				(s_0) edge node [above] {} (g_0)
				(s_0) edge node [above] {} (s_1)
				(s_1) edge node [above] {} (g_1)
				(s_1) edge node [above] {} (s_2)
				(s_2) edge node [above] {} (g_2)
				(s_2) edge node [above] {} (s_3)
				(s_3) edge node [above] {} (g_3)
				(s_3) edge node [above] {} (s_4)
				(s_4) edge node [above] {} (g_4)
				(s_4) edge node [above] {} (s_5)
				(s_5) edge node [above] {} (g_5)
				;
				\path[->]
				(g_0) edge[dotted] node [above] {} (s_1)
				(g_1) edge[dotted] node [above] {} (s_2)
				(g_2) edge[dotted] node [above] {} (s_3)
				(g_3) edge[dotted] node [above] {} (s_4)
				(g_4) edge[dotted] node [above] {} (s_5)
				;
				\node[rectangle, very thick, draw=black] (eq1) [above right of=z_4] {$c_t=\sum_{i=0}^4\alpha_i^t\times z_i$};

			\end{tikzpicture}

\begin{figure}[htbp]
		\begin{subfigure}[b]{0.2\textwidth}
		\centering
		\scalebox{1.}{
			\begin{tikzpicture}
				[
					shorten >= 1pt,
					node distance=2cm,
					>=stealth,
					initial text=,
					bigarrow/.style={single arrow, fill=orange!50, anchor=base, align=center,text width=2.8cm}
				]
				\tikzstyle{every state} = [circle, very thick, draw=orange!50, fill=orange!25]
				\node[state] (h) {$\mathbold{h}$};
				\node[] (x) [below of=h] {$\mathbold{x}$};
				\node[state] (o) [above of=h] {$\mathbold{o}$};
				\node[] (u) [above of=o] {$\mathbold{u}$};
				\path[->, very thick]
					(x) edge node [right, midway] {$\mathbold{U}$} (h)
					(h) edge node [right, midway] {$\mathbold{V}$} (o)
					(o) edge node [right, midway] {$\mathbold{W}$} (u)
					(o.north east) edge[bend left=120] node (e) {} (h.south east)
					;
			\end{tikzpicture}
		}
					\caption{RNN}
			\label{fig:rnn}
		\end{subfigure}
		\begin{subfigure}[b]{0.5\textwidth}
			\scalebox{1.}{
			\begin{tikzpicture}
				[
					shorten >= 1pt,
					node distance=2cm,
					>=stealth,
					initial text=,
					bigarrow/.style={single arrow, fill=orange!50, anchor=base, align=center,text width=2.8cm}
				]
				\tikzstyle{every state} = [circle, very thick, draw=orange!50, fill=orange!25]
				\node[state] (h0) {$\mathbold{h}_{t-1}$};
				\node[] (x0) [below of=h0] {$\mathbold{x}_{t-1}$};
				\node[state] (o0) [above of=h0] {$\mathbold{o}_{t-1}$};
				\node[] (start) [left of=o0] {};
				\node[] (u0) [above of=o0] {$\mathbold{u}_{t-1}$};
				\path[->, very thick]
					(start) edge[dotted] node [right, midway] {$\mathbold{W}$} (h0)
					(x0) edge node [right, midway] {$\mathbold{U}$} (h0)
					(h0) edge node [right, midway] {$\mathbold{V}$} (o0)
					(o0) edge node [right, midway] {} (u0)
					;
				\node[state] (h1) [right of=h0] {$\mathbold{h}_t$};
				\node[] (x1) [below of=h1] {$\mathbold{x}_t$};
				\node[state] (o1) [above of=h1] {$\mathbold{o}_t$};
				\node[] (u1) [above of=o1] {$\mathbold{u}_t$};
				\path[->, very thick]
					(o0) edge[dotted] node [right, midway] {} (h1)
					(x1) edge node [right, midway] {} (h1)
					(h1) edge node [right, midway] {} (o1)
					(o1) edge node [right, midway] {} (u1)
					;
				\node[state] (h2) [right of=h1] {$\mathbold{h}_{t+1}$};
				\node[] (x2) [below of=h2] {$\mathbold{x}_{t+1}$};
				\node[state] (o2) [above of=h2] {$\mathbold{o}_{t+1}$};
				\node[] (end) [right of=h2] {};
				\node[] (u2) [above of=o2] {$\mathbold{u}_{t+1}$};
				\path[->, very thick]
					(o1) edge[dotted] node [right, midway] {} (h2)
					(x2) edge node [right, midway] {} (h2)
					(h2) edge node [right, midway] {} (o2)
					(o2) edge node [right, midway] {} (u2)
					(o2) edge[dotted] node [right, midway] {} (end)
					;
			\end{tikzpicture}
		}
		\caption{Unraveled view of RNN}
		\label{fig:rnn-unfold}
		\end{subfigure}
	\end{figure}
